import { Box, Typography } from "@mui/material";
import React from "react";

export const Movies = () => {
  return (
    <Box margin={"auto"} marginTop={4}>
      <Typography
        margin="auto"
        variant="h4"
        padding={2}
        width={"40%"}
        bgcolor={"#900C3F"}
        color={"white"}
        textAlign={"center"}
      >
        All Movies
      </Typography>
    </Box>
  );
};
